import React from "react";
import { TouchableOpacity, View, Image, StyleSheet } from "react-native";
import { Icon } from "react-native-vector-icons/Icon";


interface Props {
  item: {
    picture: string;
  };
  onPress?: () => void;
}

const Card = ({ item, onPress }: Props) => {
  return (
    <TouchableOpacity
      activeOpacity={0.5}
      onPress={onPress}
    >
      <View style={styles.cardContainer}>
        <Image
          source={{
            uri: item.picture,
          }}
          style={styles.image}
        />
        <Icon
          name="info-circle"
          color="#ccc"
          size={20}
        />
      </View>
    </TouchableOpacity>
  );
};

const styles = StyleSheet.create({
  cardContainer: {
    backgroundColor: "#fff",
    height: 170,
    width: "100%",
    padding: 15,
    borderRadius: 30,
    alignItems: "center",
    marginVertical: 20,
    justifyContent: "center",
  },
  image: {
    height: 100,
    width: 100,
    borderRadius: 80,
  },
  iconContainer: {
    position: "absolute",
    right: 20,
    bottom: 20,
  },
});

export default Card;
